import React from "react";
import "./style/Search.css";
function Search() {
  return (
    <div className="Search">
      <div className="Container">
        <div className="logo">Netflix Community</div>
        <div className="inputbox">
          <input type="text" name="text" />
        </div>
      </div>
    </div>
  );
}

export default Search;
